import React, { useState, useEffect } from 'react';
import MemoryUploader from './MemoryUploader';
import MemorySearch from './MemorySearch';



function App() {
    const [view, setView] = useState('upload');
    const [isHovered, setIsHovered] = useState(null);
    const [memoryCount, setMemoryCount] = useState(() => {
        const stored = localStorage.getItem('memoryCount');
        return stored ? parseInt(stored) : 0;
    });

    useEffect(() => {
        const interval = setInterval(() => {
            setCurrentTime(new Date().toLocaleTimeString());
        }, 1000);
        return () => clearInterval(interval);
    }, []);

    const [currentTime, setCurrentTime] = useState(new Date().toLocaleTimeString());

    const updateMemoryCount = (newCount) => {
        setMemoryCount(newCount);
        localStorage.setItem('memoryCount', newCount.toString());
    };

    return (
        <div style={styles.container}>
            {/* ... (bubbles and header skipped for brevity) */}

            {/* Dashboard */}
            <div style={styles.dashboard}>
                {/* Sidebar */}
                <nav style={styles.sidebar}>
                    {/* Buttons */}
                    <button
                        onClick={() => setView('upload')}
                        onMouseEnter={() => setIsHovered('upload')}
                        onMouseLeave={() => setIsHovered(null)}
                        style={view === 'upload' ? styles.activeNavButton :
                            (isHovered === 'upload' ? styles.hoveredNavButton : styles.navButton)}
                    >
                        <div style={styles.buttonIcon}>üß†</div>
                        <div>
                            <div style={styles.buttonTitle}>Upload Memory</div>
                            <div style={styles.buttonSubtitle}>Encode new experiences</div>
                        </div>
                    </button>

                    <div style={styles.divider}></div>

                    <button
                        onClick={() => setView('search')}
                        onMouseEnter={() => setIsHovered('search')}
                        onMouseLeave={() => setIsHovered(null)}
                        style={view === 'search' ? styles.activeNavButton :
                            (isHovered === 'search' ? styles.hoveredNavButton : styles.navButton)}
                    >
                        <div style={styles.buttonIcon}>üîç</div>
                        <div>
                            <div style={styles.buttonTitle}>Retrieve Memory</div>
                            <div style={styles.buttonSubtitle}>Access stored memories</div>
                        </div>
                    </button>

                    {/* System Status */}
                    <div style={styles.statusPanel}>
                        <div style={styles.statusHeader}>SYSTEM STATUS</div>
                        <div style={styles.statusItem}><div style={styles.statusIndicator}></div>Neural Network: <span style={styles.statusValue}>Online</span></div>
                        <div style={styles.statusItem}><div style={styles.statusIndicator}></div>Memory Bank: <span style={styles.statusValue}>84% Capacity</span></div>
                        <div style={styles.statusItem}><div style={styles.statusIndicator}></div>Security: <span style={styles.statusValue}>Encrypted</span></div>
                    </div>
                </nav>

                {/* Main Content */}
                <div style={styles.content}>
                    <div style={styles.contentHeader}>
                        <div style={styles.currentModule}>
                            {view === 'upload' ? 'MEMORY ENCODING' : 'NEURAL RETRIEVAL'}
                        </div>
                        <div style={styles.stats}>
                            <div style={styles.statItem}>
                                <div style={styles.statValue}>{memoryCount}</div>
                                <div style={styles.statLabel}>Memories Stored</div>
                            </div>
                        </div>
                    </div>

                    <div style={styles.moduleContainer}>
                        {view === 'upload'
                            ? <MemoryUploader updateMemoryCount={updateMemoryCount} />
                            : <MemorySearch />}
                    </div>
                </div>
            </div>

            {/* Footer */}
            <footer style={styles.footer}>
                <div>Memory Augmentation Platform v1.0</div>
                <div>Today: {new Date().toLocaleString()}</div>
                <div>¬© {new Date().getFullYear()}</div>
            </footer>
        </div>
    );
}
